import { Routes, Route, Outlet } from "react-router-dom";
import Home from "./routes/home/home.component";

const Navigation =()=>{
    return(
        <div>
            <div>
                <h1>Nav bar</h1>
            </div>
        </div>
    )
}

const Shop = ()=>{
    return(
        <h1>Shop here</h1>
    )
}
const App = () => {
    return (
        <Routes>
            <Route path="/" element={<Home />} />
        </Routes>
    )
}
export default App;
